CREATE TABLE starrocks_types (
  types_id INT,
  c_boolean boolean,
  c_smallint smallint,
  c_integer integer,
  c_bigint bigint,
  c_decimal decimal,
  c_real real,
  c_double_precision double precision,
  c_varchar varchar,
  c_date date,
  c_timestamp timestamp,
  c_jsonb jsonb,
  c_boolean_array boolean[],
  c_smallint_array smallint[],
  c_integer_array integer[],
  c_bigint_array bigint[],
  c_decimal_array decimal[],
  c_real_array real[],
  c_double_precision_array double precision[],
  c_varchar_array varchar[],
  c_date_array date[],
  c_timestamp_array timestamp[],
  c_jsonb_array jsonb[],
  PRIMARY KEY (types_id)
);

